Some operators have more than one input port that can be referenced by ->. For example merge merges the contents of many flows, so it can have an abitrary number of input ports. Some operators have multiple outputs, notably tee , which has an arbitrary number of outputs. In the syntax, we distinguish input ports via an indexing prefix number in square brackets before the operator name (e.g. [0]merge(...) and [1]merge(...)). We distinguish output ports by an indexing suffix (e.g. tee[0]). Here is an example that tees one flow into two, handles each separately, and then merges them to print out the contents in both lowercase and uppercase: source = recv_iter(vec!["Hello", "world"]) -> tee();
print = merge() -> for_each(|x| println!("{}", x));
source[0] -> map(|x: &str| x.to_uppercase()) -> [0]print;
source[1] -> map(|x: &str| x.to_lowercase()) -> [1]print; (Note that the Rust code inside map needed a little help with type inference after the tee.) Here is a visualization of the flow that was generated: flowchart TB subgraph Compiled Component 2 3v1["3v1 &lt;tt&gt;op_3v1: merge()&lt;/tt&gt;"] 4v1["4v1 &lt;tt&gt;op_4v1: for_each(| x | println! (&amp;quot;{}&amp;quot;, x))&lt;/tt&gt;"] end subgraph Compiled Component 1 1v1["1v1 &lt;tt&gt;op_1v1: recv_iter(vec! [&amp;quot;Hello&amp;quot;, &amp;quot;world&amp;quot;])&lt;/tt&gt;"] 2v1["2v1 &lt;tt&gt;op_2v1: tee()&lt;/tt&gt;"] 5v1["5v1 &lt;tt&gt;op_5v1: map(| x : &amp;amp; str | x.to_uppercase())&lt;/tt&gt;"] 6v1["6v1 &lt;tt&gt;op_6v1: map(| x : &amp;amp; str | x.to_lowercase())&lt;/tt&gt;"] end 7v1{"handoff"} 8v1{"handoff"} 1v1--&gt;2v1 2v1--&gt;5v1 2v1--&gt;6v1 3v1--&gt;4v1 5v1--&gt;7v1 6v1--&gt;8v1 7v1--&gt;3v1 8v1--&gt;3v1 Hydroflow compiled this flow into two subgraphs called compiled components , connected by handoffs . You can ignore these details unless you are interested in low-level performance tuning; they are explained in the discussion of in-out trees .

